import React from 'react'

export default class ProfilePage extends React.Component {
  constructor(props){
    super(props)
    const userInfo = JSON.parse(localStorage.getItem("OPuserInfo"))
    this.state = {
      userInfo: userInfo,
    }
  }

  render(){
    return(
      <h1>{this.state.userInfo}</h1>
    )
  }
}
